import React from 'react'
import {UserFname ,UserLname} from './CompoHookA'

function CompoHookC() {
  return (
    <UserFname.Consumer>
      {
        Fname => {
          return (
            <UserLname.Consumer>
              {
                Lname => {
                  return (
                    <div>CompoHookC You Fname is {Fname} And Your Lname is {Lname}</div>
                  )
                }
              }
            </UserLname.Consumer>
          )
        }
      }
    </UserFname.Consumer>
  )
}

export default CompoHookC
